import React, { Component } from 'react';

class Links extends Component {
  render() {

    return(
    <div className="animated fadeIn">
      <LinkButtons/>
    </div>
    )
  }
}

class LinkButtons extends Component {

  // const Username = function(props) {
  //   return <button>{props.username}</p>;
  // };

  render() {
    const linkbtns = [
      {name: 'HS Comic Maker', url: 'url'},
      {name: 'HS JPN/KOR study discord', url: 'url'},
      {name: 'Hiveswap Quirk Converter', url: 'url'}
    ]

    return(
      <div>
      { linkbtns.map((el, i) => {
        return(
          <button
            index={i}
            title={el.name}
          />
      )
      })
      }
      </div>
    )
  }
}

class LinkButton extends Component {

}


export default Links;
